INSERT INTO `information` VALUES ('1', '腾讯网', '<span style=\"color: rgb(51, 51, 51); font-family: \'Microsoft Yahei\'; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">电视剧《神雕侠侣》2006年版本改编自金庸小说《神雕侠侣》。该剧主要讲述了南宋末年，杨过和小龙女经历了一番凄美爱情与江湖恩怨的故事。由张纪中任制片人，于敏任导演。</span><a target=\"_blank\" href=\"http://baike.baidu.com/view/13909.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194); font-family: \'Microsoft Yahei\'; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">黄晓明</a><span style=\"color: rgb(51, 51, 51); font-family: \'Microsoft Yahei\'; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">、</span><a target=\"_blank\" href=\"http://baike.baidu.com/view/3064.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194); font-family: \'Microsoft Yahei\'; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">刘亦菲</a><span style=\"color: rgb(51, 51, 51); font-family: \'Microsoft Yahei\'; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">、</span><a target=\"_blank\" href=\"http://baike.baidu.com/view/3871.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194); font-family: \'Microsoft Yahei\'; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">杨幂</a><span style=\"color: rgb(51, 51, 51); font-family: \'Microsoft Yahei\'; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">、陈紫函、钟镇涛等演员出演。该剧已于2006年3月14日播出。<br><img src=\"data:image/jpeg;base64,\" height=\"483\" width=\"365\"><img src=\"data:image/jpeg;base64,\" height=\"477\" width=\"373\"><br></span><br>', '2015-03-13 16:33:42', '2006年，刘亦菲拍摄《神雕侠侣》');
INSERT INTO `information` VALUES ('2', 'stackoverflow.com', '<p style=\"margin: 0px 0px 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(34, 34, 34); font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">I have a code for jqGrid with custom \"editFunc\" that opens my own jQuery-UI Panel to edit the data.</p><p style=\"margin: 0px 0px 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(34, 34, 34); font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">It saves the data without problems, but I can\'t get jqGrid to be updated with new data automatically using \"$(\"#blog-posts\").trigger(\"reloadGrid\");\" It doesn\'t work from \"editFunc\". The code is below. Not sure how to fix it. What I\'m doing wrong here?</p><p style=\"margin: 0px 0px 1em; padding: 0px; border: 0px; font-size: 15px; clear: both; color: rgb(34, 34, 34); font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Another way I thought about is to do not do a full jqGrid reload, but update only the edited data. How to update a successfully edited jqGrid row with sucessfuly changed record data \"manually\" from editFunc, without reloading all records?</p>', '2015-03-13 23:49:35', 'jqgrid-reload-from-custom-editfunc-not-working');

